A Silent Killer: Savita's Story




This brand new TV3 documentary will re-examine the heart-breaking story of Savita Halappanavar, who's death at the maternity ward in Galway hospital caught the world's attention. It will tell her story using reconstructions, interviews, along with expert medical opinions examining where the system failed her and why. Making use of evidence gathered from the coroner's report, the film aims to provide a step-by-step account of the last hours of Savita's life, and asks challenging questions about Catholic morals, the media and the Irish maternal care system.




Original Air Date: 24-Mar-2014




